void generate_primes(vector<mp::mpz_int> &primes, mp::mpz_int max)
{
    primes.clear();
    primes.push_back(2);
    for (mp::mpz_int i = 3; i <= max; i += 2) {
        bool is_prime = true;
        for (auto p : primes) {
            if (p * p > i) break;
            if (i % p == 0) {
                is_prime = false;
                break;
            }
        }
        if (is_prime) primes.push_back(i);
    }
}

void generate_prime_factors(vector<mp::mpz_int> &primes, mp::mpz_int n, vector<mp::mpz_int> &factors)
{
    factors.clear();
    for (auto p : primes) {
        if (p * p > n) break;
        if (n % p == 0) {
            factors.push_back(p);
            while (n % p == 0) n /= p;
        }
    }
    if (n > 1) factors.push_back(n);
}

int main()
{
    mp::mpz_int max = 100000;
    vector<mp::mpz_int> primes;
    generate_primes(primes, max);

    vector<mp::mpz_int> factors;
    mp::mpz_int count = 0;
    for (mp::mpz_int n = 1; n <= max; n++) {
        generate_prime_factors(primes, n, factors);
        if (factors.size() == 4) {
            count++;
        }
    }
    cout << "The answer is " << count << endl;
}

